package com.tvs.subscr;

public class Source {
	
	String id;
	String item;
	public Source(String id, String item) {
		super();
		this.id = id;
		this.item = item;
	}
	public Source() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getId() {
		return id;
	}
	public void setId(String id) {
		this.id = id;
	}
	public String getItem() {
		return item;
	}
	public void setItem(String item) {
		this.item = item;
	}
	

}
